import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Dummy = () => {
    const [data, setData] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:8081/dummy')
            .then(response => {
                console.log("Value:", response.data);
                setData(response.data || []);
            })
            .catch(error => {
                console.error('Error fetching data:', error);
                setData([]);
            });
    }, []);

    return (
        <>
            <div>
                <h1>MySQL Table Data</h1>
                <table border="1">
                    <thead>
                        <tr>
                            <th>Table No</th>
                            <th>Club</th>
                            <th>Event Name</th>
                            <th>Venue</th>
                            <th>Start Date</th>
                            <th>Start Time</th>
                            <th>End Date</th>
                            <th>End Time</th>
                            <th>No. of registrations</th>
                        </tr>
                    </thead>
                    <tbody>
                        {data.map(row => (
                            <tr key={row.id}>
                                <td>{row.table_no}</td>
                                <td>{row.club}</td>
                                <td>{row.event_name}</td>
                                <td>{row.venue}</td>
                                <td>{row.start_date}</td>
                                <td>{row.start_time}</td>
                                <td>{row.end_date}</td>
                                <td>{row.end_time}</td>
                                <td>{row.No_of_Participants}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </>
    );
};

export default Dummy;
